func TestImage2String(t *testing.T) {
	file, err := os.Open("NIH.png")
	if err != nil {
		t.Fatalf(err.Error())
	}
	defer file.Close()

	img, _, err := image.Decode(file)
	if err != nil {
		t.Fatalf(err.Error())
	}

	buf := new(bytes.Buffer)

	if err = png.Encode(buf, img); err != nil {
		t.Fatalf(err.Error())
	}

	t.Log(base64.StdEncoding.EncodeToString(buf.Bytes()))
}
